CREATE TABLE "cadet_bio" (
  "npa_no" varchar(20) NOT NULL,
  "fname" varchar(20) NOT NULL,
  "sname" varchar(20) NOT NULL,
  "onames" varchar(15) NOT NULL,
  "gender" set('M','F') NOT NULL,
  "dob" varchar(12) NOT NULL,
  "phone" varchar(15) NOT NULL,
  "email" varchar(45) NOT NULL,
  "state" set('Abia','Adamawa','Akwa-Ibom','Anambra','Bauchi','Bayelsa','Benue','Borno','Cross River','Delta','Ebonyi','Edo','EKITI','Enugu','FCT-ABUJA','Gombe','Imo','Jigawa','Kaduna','Kano','Katsina','Kebbi','Kogi','Kwara','Lagos','Nassarawa','Niger','Ogun','Ondo','Osun','Oyo','Plateau','Rivers','Sokoto','Taraba','Yobe','Zamfara') NOT NULL,
  "lga" varchar(20) NOT NULL,
  "tribe" varchar(25) NOT NULL,
  "parent_id" varchar(20) NOT NULL,
  "temp_edit_status" set('RAW','EDITED') NOT NULL,
  "del_img" set('DONE','WAITING') NOT NULL
) 

